package com.lulei.com;

public class StackDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
            int i=1;
            int j=1;
           System.out.println(i);
           System.out.println(j);
           System.out.println(++i);
           System.out.println(--j);
           test();
           
	}
	public static void test(){
		int a=0;
		System.out.println(a);
	}

}
